        '{"welcomeHeadline":["SEIU 503 Membership signup and Recommit form","Formulario de membres\xeda del SEIU 503","\u0411\u043b\u0430\u043d\u043a \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u0447\u043b\u0435\u043d\u0430 \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u044f 503 \u043f\u0440\u043e\u0444\u0441\u043e\u044e\u0437\u0430 SEIU \u0438 \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043d\u0438\u044f \u0447\u043b\u0435\u043d\u0441\u0442\u0432\u0430","M\u1eabu \u0110\u0103ng k\xfd Th\xe0nh vi\xean v\xe0 T\xe1i Cam k\u1ebft SEIU 503","SEIU 503 \u4f1a\u5458\u6ce8\u518c\u548c\u91cd\u65b0\u7533\u8bf7\u8868"],"subhead":["Building a Just and Vibrant Society","Construimos una sociedad justa y din\xe1mica","\u0421\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u0431\u043e\u043b\u0435\u0435 \u0441\u043f\u0440\u0430\u0432\u0435\u0434\u043b\u0438\u0432\u043e\u0433\u043e \u0438 \u0434\u0438\u043d\u0430\u043c\u0438\u0447\u043d\u043e\u0433\u043e \u0441\u043e\u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430","X\xe2y d\u1ef1ng X\xe3 h\u1ed9i C\xf4ng b\u1eb1ng v\xe0 S\u1ed1ng \u0111\u1ed9ng","\u5efa\u8bbe\u4e00\u4e2a\u516c\u6b63\u548c\u5145\u6ee1\u6d3b\u529b\u7684\u793e\u4f1a"],"introP1":["By joining together in union, SEIU 503 members have won incredible victories\u2014including increasing our pay and benefits and improving our workplace conditions. In states where more public employees remain members of the union, salaries are higher for all employees because the union has the power to negotiate from a position of strength.","Al unirse en un sindicato, los miembros del Sindicato Internacional de Empleados de Servicios (SEIU, por sus siglas en ingl\xe9s) 503 han obtenido incre\xedbles victorias, incluyendo incrementar nuestro sueldo y nuestros beneficios, adem\xe1s de mejorar las condiciones en nuestros lugares de trabajo. En los estados donde m\xe1s empleados p\xfablicos permanecen como miembros del sindicato, los salarios son m\xe1s altos para todos los empleados debido a que el sindicato tiene m\xe1s poder para negociar desde una posici\xf3n de fuerza.","\u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0438\u0432\u0448\u0438\u0441\u044c \u0432 \u043f\u0440\u043e\u0444\u0441\u043e\u044e\u0437, \u0447\u043b\u0435\u043d\u044b \u043c\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u044f 503 \u043f\u0440\u043e\u0444\u0441\u043e\u044e\u0437\u0430 SEIU, \u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0438 \u043d\u0435\u0432\u0435\u0440\u043e\u044f\u0442\u043d\u044b\u0435 \u043f\u043e\u0431\u0435\u0434\u044b, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u0443\u0432\u0435\u043b\u0438\u0447\u0435\u043d\u0438\u0435 \u0437\u0430\u0440\u0430\u0431\u043e\u0442\u043d\u043e\u0439 \u043f\u043b\u0430\u0442\u044b \u0438 \u043b\u044c\u0433\u043e\u0442, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435 \u0443\u0441\u043b\u043e\u0432\u0438\u0439 \u043d\u0430\u0448\u0435\u0433\u043e \u0442\u0440\u0443\u0434\u0430. \u0412 \u0448\u0442\u0430\u0442\u0430\u0445, \u0433\u0434\u0435 \u0431\u043e\u043b\u044c\u0448\u0435\u0435 \u0447\u0438\u0441\u043b\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0441\u043b\u0443\u0436\u0430\u0449\u0438\u0445 \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u0447\u043b\u0435\u043d\u0430\u043c\u0438 \u043f\u0440\u043e\u0444\u0441\u043e\u044e\u0437\u043e\u0432, \u0440\u0430\u0431\u043e\u0442\u043d\u0438\u043a\u0430\u043c \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u044e\u0442\u0441\u044f \u0431\u043e\u043b\u0435\u0435 \u0432\u044b\u0441\u043e\u043a\u0438\u0435 \u0437\u0430\u0440\u043f\u043b\u0430\u0442\u044b, \u043f\u043e\u0441\u043a\u043e\u043b\u044c\u043a\u0443 \u0443 \u043f\u0440\u043e\u0444\u0441\u043e\u044e\u0437\u0430 \u0435\u0441\u0442\u044c \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u0432\u0435\u0441\u0442\u0438 \u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u044b \u0441 \u043f\u043e\u0437\u0438\u0446\u0438\u0438 \u0441\u0438\u043b\u044b.","Qua vi\u1ec7c c\xf9ng nhau gia nh\u1eadp c\xf4ng \u0111o\xe0n, \u0111o\xe0n vi\xean SEIU 503 ch\xfang ta \u0111\xe3 gi\xe0nh \u0111\u01b0\u1ee3c nh\u1eefng chi\u1ebfn th\u1eafng \u0111\xe1ng kinh ng\u1ea1c, bao g\u1ed3m t\u0103ng l\u01b0\u01a1ng, t\u0103ng l\u1ee3i \xedch nh\xe2n vi\xean, v\xe0 c\u1ea3i thi\u1ec7n \u0111i\u1ec1u ki\u1ec7n lao \u0111\u1ed9ng t\u1ea1i n\u01a1i l\xe0m vi\u1ec7c. \u1ede nh\u1eefng ti\u1ec3u bang c\xf3 nhi\u1ec1u nh\xe2n vi\xean ch\xednh ph\u1ee7 l\xe0 th\xe0nh vi\xean l\xe2u d\xe0i c\u1ee7a c\xf4ng \u0111o\xe0n, t\u1ea5t c\u1ea3 c\xf4ng nh\xe2n vi\xean \u0111\u1ec1u c\xf3 m\u1ee9c l\u01b0\u01a1ng cao h\u01a1n v\xec c\xf4ng \u0111o\xe0n c\xf3 \u01b0u th\u1ebf \u0111\u1ec3 th\u01b0\u01a1ng l\u01b0\u1ee3ng t\u1eeb m\u1ed9t v\u1ecb tr\xed quy\u1ec1n l\u1ef1c.","\u901a\u8fc7\u56e2\u7ed3\u8d77\u6765\u52a0\u5165\u5de5\u4f1a\uff0cSEIU 503 \u4f1a\u5458\u8d62\u5f97\u8bb8\u591a\u4f1f\u5927\u80dc\u5229\uff0c\u5305\u62ec\u52a0\u85aa\u548c\u63d0\u9ad8\u798f\u5229\uff0c\u4ee5\u53ca\u6539\u5584\u6211\u4eec\u7684\u5de5\u4f5c\u73af\u5883\u3002\u5728\u66f4\u591a\u516c\u52a1\u5458\u4f9d\u7136\u62c5\u4efb\u5de5\u4f1a\u4f1a\u5458\u7684\u5dde\uff0c\u5168\u4f53\u96c7\u5458\u7684\u5de5\u8d44\u66f4\u9ad8\uff0c\u56e0\u4e3a\u5de5\u4f1a\u6709\u66f4\u5f3a\u7684\u5b9e\u529b\u5f00\u5c55\u8c08\u5224\u3002"],"introP2":["We have strength in numbers. Please complete the following form to join tens of thousands of public service workers and care providers who make Oregon a great place to work and live. By doing so, you will commit to maintaining your membership for one year, or paying a non-member fee equivalent. Dues are 1.7% of your salary + $2.75/month. Your full name, network address, and a timestamp of your submission will serve as your signature.","Estamos m\xe1s fuertes juntos. Complete el siguiente formulario para unirse a decenas de miles de trabajadores del servicio p\xfablico y proveedores de atenci\xf3n que hacen que Oregon sea un gran lugar para trabajar y vivir. Al hacerlo, usted se comprometer\xe1 a mantener su membres\xeda durante un a\xf1o, o pagar una tarifa equivalente como no miembro. Las tarifas son el 1.7 % de su salario + $2.75 al mes. Su nombre completo, la direcci\xf3n de la red y un sello de hora de su entrega servir\xe1 como su firma. ","\u041d\u0430\u0448\u0430 \u0441\u0438\u043b\u0430 \u0432 \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u0435 \u0447\u043b\u0435\u043d\u043e\u0432. \u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u0437\u0430\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0439 \u043d\u0438\u0436\u0435 \u0431\u043b\u0430\u043d\u043a, \u0447\u0442\u043e\u0431\u044b \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0438\u0442\u044c\u0441\u044f \u043a \u0442\u044b\u0441\u044f\u0447\u0430\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0441\u043b\u0443\u0436\u0430\u0449\u0438\u0445 \u0438 \u0440\u0430\u0431\u043e\u0442\u043d\u0438\u043a\u043e\u0432 \u0441\u0444\u0435\u0440\u044b \u043e\u0431\u0441\u043b\u0443\u0436\u0438\u0432\u0430\u043d\u0438\u044f, \u0441\u043f\u043e\u0441\u043e\u0431\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0445 \u0442\u043e\u043c\u0443, \u0447\u0442\u043e\u0431\u044b \u0448\u0442\u0430\u0442 \u041e\u0440\u0435\u0433\u043e\u043d \u0431\u044b\u043b \u043f\u0440\u0435\u043a\u0440\u0430\u0441\u043d\u044b\u043c \u043c\u0435\u0441\u0442\u043e\u043c \u0434\u043b\u044f \u0440\u0430\u0431\u043e\u0442\u044b \u0438 \u0436\u0438\u0437\u043d\u0438. \u0422\u0435\u043c \u0441\u0430\u043c\u044b\u043c \u0432\u044b \u043e\u0431\u044f\u0437\u0443\u0435\u0442\u0435\u0441\u044c \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u0442\u044c \u0441\u0432\u043e\u0435 \u0447\u043b\u0435\u043d\u0441\u0442\u0432\u043e \u0432 \u043f\u0440\u043e\u0444\u0441\u043e\u044e\u0437\u0435 \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u043e\u0434\u043d\u043e\u0433\u043e \u0433\u043e\u0434\u0430 \u0438\u043b\u0438 \u043e\u043f\u043b\u0430\u0447\u0438\u0432\u0430\u0442\u044c \u0432\u0437\u043d\u043e\u0441\u044b \u043d\u0435 \u0434\u043b\u044f \u0447\u043b\u0435\u043d\u043e\u0432 \u043f\u0440\u043e\u0444\u0441\u043e\u044e\u0437\u0430, \u0440\u0430\u0432\u043d\u044b\u0435 \u043f\u043e \u0441\u0443\u043c\u043c\u0435 \u0447\u043b\u0435\u043d\u0441\u043a\u0438\u043c \u0432\u0437\u043d\u043e\u0441\u0430\u043c. \u0421\u0443\u043c\u043c\u0430 \u0432\u0437\u043d\u043e\u0441\u043e\u0432 \u0440\u0430\u0432\u043d\u0430 1,7% \u0432\u0430\u0448\u0435\u0439 \u0437\u0430\u0440\u043f\u043b\u0430\u0442\u044b + 2,75 \u0434\u043e\u043b\u043b. \u0432 \u043c\u0435\u0441\u044f\u0446. \u0412\u0430\u0448\u0438 \u0438\u043c\u044f \u0438 \u0444\u0430\u043c\u0438\u043b\u0438\u044f, \u0447\u0438\u0441\u043b\u043e\u0432\u043e\u0439 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0442\u043e\u0440 \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u0430 \u0438 \u043e\u0442\u043c\u0435\u0442\u043a\u0430 \u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0438 \u043f\u043e\u0434\u0430\u0447\u0438 \u0430\u043d\u043a\u0435\u0442\u044b \u0431\u0443\u0434\u0443\u0442 \u0441\u043b\u0443\u0436\u0438\u0442\u044c \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0432\u0430\u0448\u0435\u0439 \u043f\u043e\u0434\u043f\u0438\u0441\u0438.","Ch\xfang ta c\xf3 s\u1ee9c m\u1ea1nh v\u1ec1 s\u1ed1 l\u01b0\u1ee3ng. Vui l\xf2ng \u0111i\u1ec1n v\xe0o m\u1eabu sau \u0111\u1ec3 tham gia c\xf9ng h\xe0ng ch\u1ee5c ng\xe0n nh\xe2n vi\xean ng\xe0nh d\u1ecbch v\u1ee5 c\xf4ng v\xe0 nh\xe2n vi\xean/nh\xe0 ch\u0103m s\xf3c, nh\u1eefng ng\u01b0\u1eddi \u0111ang l\xe0m cho ti\u1ec3u bang Oregon tr\u1edf th\xe0nh m\u1ed9t n\u01a1i tuy\u1ec7t v\u1eddi \u0111\u1ec3 l\xe0m vi\u1ec7c v\xe0 sinh s\u1ed1ng. Qua vi\u1ec7c \u0111i\u1ec1n \u0111\u01a1n, qu\xfd v\u1ecb s\u1ebd cam k\u1ebft duy tr\xec t\u01b0 c\xe1ch th\xe0nh vi\xean c\u1ee7a m\xecnh trong m\u1ed9t n\u0103m ho\u1eb7c tr\u1ea3 m\u1ed9t kho\u1ea3n ph\xed t\u01b0\u01a1ng \u1ee9ng \xe1p d\u1ee5ng cho nh\u1eefng ng\u01b0\u1eddi kh\xf4ng l\xe0 th\xe0nh vi\xean. Kho\u1ea3n ph\xed n\xe0y l\xe0 1.7% ti\u1ec1n l\u01b0\u01a1ng c\u1ee7a qu\xfd v\u1ecb + $2.75/th\xe1ng. H\u1ecd t\xean, \u0111\u1ecba ch\u1ec9 m\u1ea1ng, v\xe0 m\u1ed9t con d\u1ea5u \u0111\xe1nh d\u1ea5u th\u1eddi gian qu\xfd v\u1ecb n\u1ed9p m\u1eabu n\xe0y s\u1ebd thay th\u1ebf cho ch\u1eef k\xfd c\u1ee7a qu\xfd v\u1ecb.","\u6211\u4eec\u62e5\u6709\u6570\u91cf\u4e0a\u7684\u4f18\u52bf\u3002\u8bf7\u586b\u5199\u4ee5\u4e0b\u8868\u683c\uff0c\u52a0\u5165\u6210\u5343\u4e0a\u4e07\u540d\u516c\u5171\u670d\u52a1\u5de5\u4f5c\u8005\u548c\u62a4\u7406\u63d0\u4f9b\u8005\u7684\u884c\u5217\uff0c\u4f7f\u4fc4\u52d2\u5188\u5dde\u6210\u4e3a\u4e00\u4e2a\u9002\u5408\u5de5\u4f5c\u548c\u751f\u6d3b\u7684\u597d\u5730\u65b9\u3002\u60a8\u8fd9\u6837\u505a\uff0c\u5373\u8868\u660e\u60a8\u5c06\u627f\u8bfa\u7ef4\u6301\u4e00\u5e74\u7684\u4f1a\u5458\u8d44\u683c\uff0c\u6216\u652f\u4ed8\u7b49\u989d\u7684\u975e\u4f1a\u5458\u8d39\u7528\u3002\u4f1a\u8d39\u4e3a\u60a8\u7684\u85aa\u8d44\u7684 1.7% + 2.75 \u7f8e\u5143/\u6708\u3002\u60a8\u63d0\u4ea4\u7684\u59d3\u540d\u3001\u7f51\u7edc\u5730\u5740\u548c\u65f6\u95f4\u6233\u5c06\u4f5c\u4e3a\u60a8\u7684\u7b7e\u540d\u3002"]}'
